import React from 'react';
import { HiOutlineMenuAlt1 } from "react-icons/hi";

const toolbar = props => (
    <div className="col-lg-5 col-md-4 col-6 ">
        <a href="#" className="push-menu-btn">
            <HiOutlineMenuAlt1 />
        </a>
    </div>
);

export default Toolbar;
